import React from 'react'
import "./Table.css"


const Table = (props) => {
    
    console.log(props);

  return (
      <table className='w-full table-fixed text-center'>
          <thead className='text-3xl'>
              <tr>
                  <th>{props.name} Rack</th>
              </tr>
          </thead>
          <tbody>
              {props.rack?.map((item) => {
                  return (
                    <tr className=''>
                          <td className=' h-10'>{item}</td>
                </tr>
                  )
              })}
              
            
          </tbody>
    </table>
  )
}

export default Table
